import React from 'react'

export default function ToggleFavorites({ toggle, showFavorites }) {
    return (
        <>
            <span className="toggle-favorites">
                <button onClick={this.props.toggle}>
                    {
                        showFavorites
                        ? "Bodacious Tunes"
                        : "Gag Me With A Spoon"
                    }
                </button>
            </span>
        </>
    )
}
